import styled, { css } from "styled-components/macro";

export const StyledButton = styled.button`
  color: black;
  background: white;
  font-size: 20px;
  border-radius: 5px;

  ${prop => 
    prop.primary && 
    css`
      color: green;
      background: grey;
    `
  };
`;

export const Container = styled.div`
  text-align: center;
`;
